import React from 'react'
import { Button, DialogTitle, Dialog, TextField } from "@material-ui/core";
import { useState } from "react"
import { Form } from 'react-bootstrap';
import { DialogContent } from '@material-ui/core';

function EditUser({user}){

  // const [open, setOpen] = useState(false);
  const [open, setOpen] = React.useState(false);


  const handleClickToOpen = () => {
    setOpen(true);
  };

  const handleToClose = () => {
    setOpen(false);
  };


  function handleSubmit(){
    console.log("submitted")
  }

  console.log(user)

  return(
    <>
        <Button variant="outlined" color="primary" onClick={handleClickToOpen}>
          Signup
        </Button>
        <Dialog open={open} onClose={handleToClose} onSubmit={handleSubmit} >
        <DialogTitle>Sign Up</DialogTitle>
        <DialogContent>
        <Form>
        <TextField 
          required
          id="outline-required"
          label="Required"
          defaultValue={user?.first_name}
        ></TextField>
            <TextField 
          required
          id="outline-required"
          label="Required"
          defaultValue={user?.last_name}
        ></TextField>
            <TextField 
          required
          id="outline-required"
          label="Required"
          defaultValue={user?.username}
        ></TextField>
            <TextField 
          required
          id="outline-required"
          label="Required"
          defaultValue={user?.email}
        ></TextField>
        </Form>
        </DialogContent>
        <Button onClick={handleToClose} font-color="red" autoFocus>
          Close
        </Button>
      </Dialog>
      </>
    )
}
export default EditUser
